Documents are composed of text and groups . Text is a unicode string modeled by the DocString type. Groups are similar to HTML elements, having a set of "attributes" and then a vector of children which can be either text or other groups. In Rust, enum DocElement models these two types: type DocSpan = Vec<DocElement>; type Attrs = HashMap<String, String>; enum DocElement { DocChars(DocString), DocGroup(Attrs, DocSpan),
} You can use the oatie::macros::doc_span! macro to conveniently create DocSpan objects: doc_span![ DocGroup({"tag": "h1"}, ["Title"]), DocGroup({"tag": "bullet"}, [ DocGroup({"tag": "p"}, ["Groups can be nested."]), DocGroup({"tag": "p"}, ["With multiple elements."]), ]),
]

