Operations are sequences of steps that when applied to a document, modifies the document by adding or removing content. Operations are broken down into two stages: deleting content, then adding content. This pair of "delete" and "add" steps makes up an operation, which is performed atomically on a document, ensuring that the result is always valid. Operations can be "applied" to a document, producing a new document: let updated_doc = Op::apply(&doc, &operation); When applying multiple operation pairs in a row, you can also "compose" them to produce a single operation that would produce the same result: let updated_doc_1 = Op::apply(&doc, &operation_1);
let updated_doc_2 = Op::apply(&updated_doc_1, &operation_2); // Same result
let updated_doc_2 = Op::apply( &doc, &Op::compose(&operation_1, &operation_2), // Composed operation
); You can also transform two concurrent operation; see the section on operational transform .

