Let's start with a simple document composed of a title and a paragraph. The document looks like the following in Markdown: # Title Body And would have the following document representation: let doc = doc_span![ DocGroup({"tag": "h1"}, [DocChars("Title")]), DocGroup({"tag": "p"}, [DocChars("Body")]),
]; Imagine the user starts editing. The user places their caret to the left of the word "Body", then hits backspace. What will happen is that the paragraph containing "Body" and the header containing the text "Title" will become combined into one header with the text "TitleBody". There are a few ways to can imagine combining these two elements. The way in which edit-text implements this is by first deleting the current and preceding blocks while preserving their content, then creating a new element which spans the content of both blocks. First, we would delete each block group: let deletion = del_span![ DelGroup([DelSkip(5)]), // Five characters in "Title" DelGroup([DelSkip(4)]), // Four characters in "Body"
]; assert_eq!( Op::apply_deletion(&doc, &deletion), doc_span![DocChars("TitleBody")],
); The result is just the characters "TitleBody". In edit-text, you are not allowed to have top-level textual content that is not contained inside of a group. So in order to produce a valid document, we now have to wrap the contents of both groups inside of a new group: let addition = del_span![ AddGroup({"tag": "h1"}, [ AddSkip(9) // Nine characters in "Titlebody" ])
]; assert_eq!( Op::apply_addition(&Op::apply_deletion(&doc, &deletion), &addition), doc_span![ DocGroup({"tag": "h1"}, [DocChars("TitleBody")]), ];
); A deletion followed by an addition is common enough in edit-text that you can work with it as a single datatype. The method Op::apply takes a document and a &(DelSpan, AddSpan) type, and returns a modified document. type Op = (DelSpan, AddSpan); let valid_op: Op = ( del_span![ DelGroup([DelSkip(5)]), DelGroup([DelSkip(4)]), ], add_span![ AddGroup({"tag": "h1"}, [AddSkip(9)]), ],
); assert_eq!( Op::apply(&doc, &valid_op), doc_span![ DocGroup({"tag": "h1"}, [DocChars("TitleBody")]), ];
);

