In the end of this hypothetical, we are now transforming these two operations: // Client A
Op([ DelGroup([DelSkip(7)]), DelGroup([DelGroup([]), DelChars(7)]),
], [ AddGroup({"tag": "h1"}, [AddGroup({"tag": "caret", "client": "A"}), AddSkip(14)]),
]) // Client B
Op([ DelGroup([DelGroup([]), DelSkip(7)]), DelWithGroup([DelSkip(7), DelChars(1)]),
], [ AddSkip(1), AddWithGroup([AddSkip(8), AddGroup({"tag": "caret", "client": "B"}, [])]),
]) And we know exactly what each result is generated from applying each operation to our original document (first shown at the beginning of this document): // Original document
<h1><caret client=B" />Hello </h1>
<p><caret client="A" /> world!</p> // Client A
<h1><caret client="A" /><caret client=B" />Hello </p> // Client B
<h1>Hello </h1>
<p><caret client="A" /> world<caret client=B" /></p> But when transforming, by design, we avoid needing knowledge of what the document looks like. So let's evaluate these operations as though we didn't know what the result was going to look like. In particular, we want to look at how the paragraph, " world!" , is modified. Client A has deleted it entirely, whereas Client B deleted a character and inserted its caret: Op([DelGroup([DelGroup([]), DelChars(7)])], [])
Op([DelWithGroup([DelSkip(7), DelChars(1)])], [AddWithGroup([AddSkip(8), AddGroup({"tag": "caret", "client": "B"}, [])])]) We can take the union of the deletions and since there is only one addition component, select it. When we transform the two, our result looks like this: Op([DelGroup([DelGroup([]), DelChars(7)])], [AddGroup({"tag": "caret", "client": "B"}, [])]) If you imagine a document consisting of only this element, and we see that one client has deleted the entire element, we accidentally wind up with a client's caret being in the root element (instead of block element). See [Splitting image](./diary-markdown.md]. To avoid this problem, the Delall hack delets alls newly inserted elements from an insertion that is transformed against a deletion that delets all content. We can verify any arbitrary DelGroup delets all of its inner contents using a recursive check.
